import React from 'react';
import AppLayout from '../components/AppLayout';

const Signup = () => (
  <>
  <Head>
    <title>프로필 | boardReact</title>
  </Head>
  <AppLayout>
    <div>Hello, Signup</div>
  </AppLayout>
</>
);

export default Signup;
